Answer: 
Since the <fact2>equilateral triangle</fact2> has an <fact4>area of the triangle</fact4> equal to $16\sqrt{3}$ square centimeters, its side length $s$ satisfies the equation $\frac{s^2\sqrt{3}}{4}=16\sqrt{3}$, so $s=8$. Since the <fact1>square</fact1> and the <fact2>equilateral triangle</fact2> have equal <fact3>perimeters</fact3>, the side length of the <fact1>square</fact1> is equal to $\frac{3}{4}s=6$. Therefore, the length of a <fact5>diagonal of the square</fact5> is equal to $6\sqrt{2}=\boxed{6\sqrt{2}}$ centimeters.

